import './App.css';
import About from './components/About';
import Home from './components/Home';
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Link,
} from "react-router-dom";
import Navbar from './components/Navbar';
function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <Home/>
    },
    {
      path: "about",
      element: <About/>
    },
  ]);
  return (
    <>
          {/* <Navbar/> */}
    <RouterProvider router={router} />
    </>
  );
}

export default App;
